import React from "react";
import s from './Lastnews.module.css';



const Lastnews = () => {
    return <div>
        <h2> Новости  </h2>
        <div className={s.lastnews}>
        <div> 14.03.22</div>
        <div>Язык, наука и техника в диалоге культур в 2022 году <br/>

        </div>
        </div>
    </div>
}

export default Lastnews;
